using Microsoft.AspNetCore.Http.HttpResults;
using Microsoft.AspNetCore.Mvc;
using Newtonsoft.Json;
using System.Net;
using System.Reflection;
using System.Text;
using System.Text.Json;
using TestTaskWebApp.Models;

namespace TestTaskWebApp.Services
{
    public class UserApiController
    {
        private readonly HttpClient _httpClient;

        public UserApiController(HttpClient httpClient)
        {
            _httpClient = httpClient;
            // httpClient.BaseAddress = new Uri("https://your-api-base-url.com/api/");
        }

        public async Task<List<User>> GetAllUsers()
        {
            var response = await _httpClient.GetAsync("api/User/getall");
            response.EnsureSuccessStatusCode();

             var content = await response.Content.ReadAsStringAsync();


            var userData = JsonConvert.DeserializeObject<ResponseData>(content);

            // userData now contains the deserialized data
            return userData.Data.ToList();




        }
        public async Task<CreateUser> GetAllUsersbyid(int id)
        {
            //var response = await _httpClient.GetAsync("api/User/get/{userId}");
            var response = await _httpClient.GetAsync($"api/User/get/{id}");
            response.EnsureSuccessStatusCode();

            var content = await response.Content.ReadAsStringAsync();

            var userData = JsonConvert.DeserializeObject<ResponseDataNormal<CreateUser>>(content);
            //var userData = JsonConvert.DeserializeObject<ResponseData>(content);

            // userData now contains the deserialized data
            return userData.Data;




        }

        public async Task<string> Login(LoginModel model)
        {
            //var response = await _httpClient.GetAsync("api/User/get/{userId}");
            var response = await _httpClient.PostAsJsonAsync($"api/User/signin", model);
            response.EnsureSuccessStatusCode();

            var loginResponse = await response.Content.ReadFromJsonAsync<LoginResponse>();

            // Store the token in session or cookie for authentication
           
            return loginResponse.Data;




        }

        public async Task<IActionResult> DeleteUser(int id)
        {
            var response = await _httpClient.DeleteAsync($"api/User/delete/{id}");

            // Check if the request was successful
            if (response.IsSuccessStatusCode)
            {
                // Redirect to a success page or return a success message
                return new OkResult();
            }
            else
            {
                // Handle errors
                // Optionally, you can handle different error conditions and return appropriate status codes
                if (response.StatusCode == HttpStatusCode.NotFound)
                {
                    return new NotFoundResult(); // Return a 404 Not Found response
                }
                else
                {
                    return new StatusCodeResult((int)response.StatusCode); // Return the status code received from the API
                }
            }


        }

        public async Task<IActionResult> CreateUser(CreateUser user)
        {

            
            user.ProfilePicture = "";
            var response = await _httpClient.PostAsJsonAsync("api/User/register", user);

            if (response.IsSuccessStatusCode)
            {
                return new OkResult(); // Return a 200 OK response without any content
            }
            else
            {
                // Optionally, you can handle different error conditions and return appropriate status codes
                if (response.StatusCode == HttpStatusCode.NotFound)
                {
                    return new NotFoundResult(); // Return a 404 Not Found response
                }
                else if (response.StatusCode == HttpStatusCode.BadRequest)
                {
                    // Handle bad request errors
                    // For example, you might deserialize the response content to get more information about the error
                    var errorContent = await response.Content.ReadAsStringAsync();
                    // Return a 400 Bad Request response with the error content
                    return new BadRequestObjectResult(errorContent);
                }
                else
                {
                    // Return a generic 500 Internal Server Error response
                    return new StatusCodeResult((int)response.StatusCode);
                }
            }
        }

        public async Task<IActionResult> UpdateUser(CreateUser user)
        {

           
            user.ProfilePicture = "";
            //var response = await _httpClient.PostAsJsonAsync("api/User/register", user);
            
            var response = await _httpClient.PutAsJsonAsync($"api/User/update/{user.UserId}", user);
            if (response.IsSuccessStatusCode)
            {
                return new OkResult(); // Return a 200 OK response without any content
            }
            else
            {
                // Optionally, you can handle different error conditions and return appropriate status codes
                if (response.StatusCode == HttpStatusCode.NotFound)
                {
                    return new NotFoundResult(); // Return a 404 Not Found response
                }
                else if (response.StatusCode == HttpStatusCode.BadRequest)
                {
                    // Handle bad request errors
                    // For example, you might deserialize the response content to get more information about the error
                    var errorContent = await response.Content.ReadAsStringAsync();
                    // Return a 400 Bad Request response with the error content
                    return new BadRequestObjectResult(errorContent);
                }
                else
                {
                    // Return a generic 500 Internal Server Error response
                    return new StatusCodeResult((int)response.StatusCode);
                }
            }
        }
        public async Task<string> ConvertImageToBase64(IFormFile imagePath)
        {
            try
            {
                using (MemoryStream memoryStream = new MemoryStream())
                {
                  //  await imageFile.CopyToAsync(memoryStream);
                    byte[] bytes = memoryStream.ToArray();
                    return Convert.ToBase64String(bytes);
                }
            }
            catch (Exception ex)
            {
                Console.WriteLine($"Error converting image to Base64: {ex.Message}");
                return null;
            }
        }

    }
}
